}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`本部分将介绍 Rancher 2.x 的源代码仓库，如何构建源代码以及在提交 Issue 时要包括哪些信息。`}</p>
    <p>{`有关如何为 Rancher 2.x 的开发做出贡献的更多详细信息，请参阅`}<a parentName="p" {...{
        "href": "https://github.com/rancher/rancher/wiki"
      }}>{`Rancher 开发指南`}</a>{`。这个 Wiki 具有许多主题的资源，包括：`}</p>
    <ul>
      <li parentName="ul">{`如何设置 Rancher 开发环境并运行测试`}</li>
      <li parentName="ul">{`Issue 在整个开发生命周期中的流程`}</li>
      <li parentName="ul">{`编码指南和开发最佳实践`}</li>
      <li parentName="ul">{`调试和故障排查`}</li>
      <li parentName="ul">{`开发 Rancher API`}</li>
    </ul>
    <p>{`在 Slack 上，Rancher 开发人员的频道是 `}<strong parentName="p">{`#developer`}</strong>{`。在我们的官方微信交流群中，每个群也都有 Rancher 的开发者。`}</p>
    <p><img parentName="p" {...{
        "src": "/img/contributing/ewm.jpg",
        "alt": "img"
      }}></img></p>
    <h2 {...{
      "id": "源代码仓库"
    }}>{`源代码仓库`}</h2>
    <p>{`所有代码库都位于我们官方的 GitHub 账号下。有许多用于 Rancher 的代码库，我们将对 Rancher 中使用的一些主要代码库进行描述。`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`代码库`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`URL`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Rancher`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://github.com/rancher/rancher"
            }}>{`https://github.com/rancher/rancher`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该库是 Rancher 2.x 的主要源代码。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Types`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://github.com/rancher/types"
            }}>{`https://github.com/rancher/types`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该库存有 Rancher 2.x 所有 API 定义。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`API Framework`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://github.com/rancher/norman"
            }}>{`https://github.com/rancher/norman`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该库是一个 API 框架，用于构建基于 Kubernetes CRD 和 Controller 的 Rancher 风格的 API。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`UI`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://github.com/rancher/ui"
            }}>{`https://github.com/rancher/ui`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该库是 UI 的代码库。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Rancher Docker Machine`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://github.com/rancher/machine"
            }}>{`https://github.com/rancher/machine`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该库是使用主机驱动时使用的 Rancher Docker Machine 二进制文件的源。这是 `}<inlineCode parentName="td">{`docker/machine`}</inlineCode>{` 库的 fork.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`machine-package`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://github.com/rancher/machine-package"
            }}>{`https://github.com/rancher/machine-package`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该库用于构建 Rancher Docker Machine 二进制文件。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`kontainer-engine`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://github.com/rancher/kontainer-engine"
            }}>{`https://github.com/rancher/kontainer-engine`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该库是 kontainer-engine 的源代码，kontainer-engine 是用于配置托管 Kubernetes 集群的工具。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`RKE`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://github.com/rancher/rke"
            }}>{`https://github.com/rancher/rke`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该库是 Rancher Kubernetes Engine 的代码库，Rancher Kubernetes Engine 是在任何机器构建，配置 Kubernetes 集群的工具。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`CLI`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://github.com/rancher/cli"
            }}>{`https://github.com/rancher/cli`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该库是 Rancher 2.x 中使用的 Rancher CLI 的源代码。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Rancher Helm`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://github.com/rancher/helm"
            }}>{`https://github.com/rancher/helm`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该库是打包的 Helm 二进制文件的来源。这是 `}<inlineCode parentName="td">{`helm/helm`}</inlineCode>{` 库的分支。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Telemetry`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://github.com/rancher/telemetry"
            }}>{`https://github.com/rancher/telemetry`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该库是采集遥测数据的源代码库。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`loglevel`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://github.com/rancher/loglevel"
            }}>{`https://github.com/rancher/loglevel`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该库是日志级别二进制文件的源代码库，用于动态更改日志级别。`}</td>
        </tr>
      </tbody>
    </table>
    <p>{`要查看 Rancher 中使用的所有库/项目，请在 `}<inlineCode parentName="p">{`rancher/rancher`}</inlineCode>{` 库查看`}<a parentName="p" {...{
        "href": "https://github.com/rancher/rancher/blob/master/go.mod"
      }}>{` `}<inlineCode parentName="a">{`go.mod`}</inlineCode>{` 文件`}</a>{`。`}</p>
    <p><img parentName="p" {...{
        "src": "/img/rancher/ranchercomponentsdiagram.svg",
        "alt": "Rancher diagram"
      }}></img></p>
    <br />
    <sup>用于配置/管理Kubernetes集群的Rancher组件。</sup>
    <h2 {...{
      "id": "编译，构建源代码"
    }}>{`编译，构建源代码`}</h2>
    <p>{`每个源代码仓库都有一个 Makefile，并且可以使用 `}<inlineCode parentName="p">{`make`}</inlineCode>{` 命令来构建。`}<inlineCode parentName="p">{`make`}</inlineCode>{` 的 targets 就是`}<inlineCode parentName="p">{`/scripts`}</inlineCode>{` 目录中的脚本，每个 target 都将使用 `}<a parentName="p" {...{
        "href": "https://github.com/rancher/dapper"
      }}>{`Dapper`}</a>{` 在隔离的环境中执行构建。这个过程是通过`}<inlineCode parentName="p">{`Dockerfile.dapper`}</inlineCode>{`完成的，其中包括所有所需要的构建工具。`}</p>
    <p>{`默认 target 是 `}<inlineCode parentName="p">{`ci`}</inlineCode>{` ，这个 target 将运行 `}<inlineCode parentName="p">{`./scripts/validate`}</inlineCode>{` 、 `}<inlineCode parentName="p">{`./scripts/build`}</inlineCode>{` 、 `}<inlineCode parentName="p">{`./scripts/package`}</inlineCode>{` 和 `}<inlineCode parentName="p">{`./scripts/package`}</inlineCode>{`。构建的出的二进制文件将位于 `}<inlineCode parentName="p">{`./build/bin`}</inlineCode>{` 中，并且通常也会生成相应的 Docker 镜像。`}</p>
    <h2 {...{
      "id": "缺陷，问题和询问"
    }}>{`缺陷，问题和询问`}</h2>
    <p>{`如果您发现任何错误或遇到任何问题，请搜索`}<a parentName="p" {...{
        "href": "https://github.com/rancher/rancher/issues"
      }}>{`已经报告的 Issues`}</a>{`，因为可能有人遇到过相同的问题或我们正在积极寻求解决方案。`}</p>
    <p>{`如果没有找到与您问题相关的 issue，请通过`}<a parentName="p" {...{
        "href": "https://github.com/rancher/rancher/issues/new"
      }}>{`创建 Issue`}</a>{`与我们联系。尽管我们有许多与 Rancher 相关的代码库，但我们希望将问题记录在 `}<inlineCode parentName="p">{`rancher/rancher`}</inlineCode>{` 的代码库中，这样我们就不会错过它们！如果您想提出问题或向其他用户询问使用案例，我们建议在`}<a parentName="p" {...{
        "href": "https://forums.rancher.com"
      }}>{`Rancher 全球论坛`}</a>{`或`}<a parentName="p" {...{
        "href": "https://forums.cnrancher.com/"
      }}>{`Rancher 中文论坛`}</a>{`上发布问题，或者在 Rancher 微信交流群中和大家一起讨论。`}</p>
    <h3 {...{
      "id": "提交问题清单"
    }}>{`提交问题清单`}</h3>
    <p>{`提出问题时，请遵循此清单，这将有助于我们调查问题并加快解决问题。更多信息意味着我们可以使用更多数据来确定导致问题的原因或相关原因。`}</p>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`注意：`}</strong>{`对于大量数据，请使用`}<a parentName="p" {...{
          "href": "https://gist.github.com/"
        }}>{`GitHub Gist`}</a>{`或类似方法，并在问题中链接创建的资源。`}</p>
      <div parentName="blockquote" {...{
        "className": "admonition admonition-important alert alert--info"
      }}><div parentName="div" {...{
          "className": "admonition-heading"
        }}><h5 parentName="div"><span parentName="h5" {...{
              "className": "admonition-icon"
            }}><svg parentName="span" {...{
                "xmlns": "http://www.w3.org/2000/svg",
                "width": "14",
                "height": "16",
                "viewBox": "0 0 14 16"
              }}><path parentName="svg" {...{
                  "fillRule": "evenodd",
                  "d": "M7 2.3c3.14 0 5.7 2.56 5.7 5.7s-2.56 5.7-5.7 5.7A5.71 5.71 0 0 1 1.3 8c0-3.14 2.56-5.7 5.7-5.7zM7 1C3.14 1 0 4.14 0 8s3.14 7 7 7 7-3.14 7-7-3.14-7-7-7zm1 3H6v5h2V4zm0 6H6v2h2v-2z"
                }}></path></svg></span>{`重要`}</h5></div><div parentName="div" {...{
          "className": "admonition-content"
        }}><p parentName="div">{`请删除所有敏感数据，因为这些数据可能会被公开查看。`}</p></div></div>
    </blockquote>
    <ul>
      <li parentName="ul">
        <p parentName="li"><strong parentName="p">{`资源：`}</strong>{` 尽可能提供有关已使用资源的详细信息。问题的根源可能是很多，包括尽可能多的细节有助于确定根本原因。请参阅以下示例：`}</p>
        <ul parentName="li">
          <li parentName="ul"><strong parentName="li">{`主机：`}</strong>{` 主机具有什么规格，例如：CPU/内存/磁盘；它在什么环境运行，比如：物理机、虚拟机、云主机；使用的是什么 系统镜像；`}</li>
          <li parentName="ul"><strong parentName="li">{`操作系统：`}</strong>{` 您使用什么操作系统？提供详细信息是非常有帮助，例如：确切的操作系统版本（ `}<inlineCode parentName="li">{`cat /etc/os-release`}</inlineCode>{` ）和内核版本（ `}<inlineCode parentName="li">{`uname -r`}</inlineCode>{` ）。`}</li>
          <li parentName="ul"><strong parentName="li">{`Docker：`}</strong>{` 您正在使用的 Docker 版本与安装方式；可以通过执行 `}<inlineCode parentName="li">{`docker version`}</inlineCode>{` 和 `}<inlineCode parentName="li">{`docker info`}</inlineCode>{` 输出更多的 Docker 配置信息。`}</li>
          <li parentName="ul"><strong parentName="li">{`环境：`}</strong>{` 您是否在代理环境中，是否正在使用可信的 CA，还是在用自签名证书，是否正在使用外部负载均衡器。`}</li>
          <li parentName="ul"><strong parentName="li">{`Rancher：`}</strong>{` 您正在使用的 Rancher 版本与 Rancher 部署方式，单容器运行还是 HA 运行；Rancher 版本可以在 Rancher UI 的左下方找到，也可以从主机上运行的 Image 的 Tag 中找到。`}</li>
          <li parentName="ul"><strong parentName="li">{`K8S 集群：`}</strong>{` 您创建了哪种 k8s 集群，如何创建的，在创建集群时自定义了什么参数。`}</li>
        </ul>
      </li>
      <li parentName="ul">
        <p parentName="li"><strong parentName="p">{`重现此问题的步骤：`}</strong>{` 请尽量详细的提供您是如何遇到所报告的情况的信息，这有助于重现您遇到的情况。`}</p>
        <ul parentName="li">
          <li parentName="ul">{`提供手动步骤或自动化脚本，用于从新创建的设置获取您所报告的情况。`}</li>
        </ul>
      </li>
      <li parentName="ul">
        <p parentName="li"><strong parentName="p">{`日志：`}</strong>{` 提供使用资源中的数据/日志。`}</p>
        <ul parentName="li">
          <li parentName="ul">
            <p parentName="li">{`Rancher Server 日志`}</p>
            <ul parentName="li">
              <li parentName="ul">
                <p parentName="li">{`通过 Docker 安装的 Rancher Server`}</p>
                <pre parentName="li"><code parentName="pre" {...{
                    "className": "language-bash"
                  }}>{`docker logs \\
--timestamps \\
$(docker ps | grep -E "rancher/rancher:|rancher/rancher " | awk '{ print $1 }')
`}</code></pre>
              </li>
              <li parentName="ul">
                <p parentName="li">{`通过 `}<inlineCode parentName="p">{`kubectl`}</inlineCode>{` 安装在 Kubernetes 中的 Rancher Server`}</p>
                <blockquote parentName="li">
                  <p parentName="blockquote"><strong parentName="p">{`注意：`}</strong>{` 确保已配置正确的 kubeconfig（例如，如果在 Kubernetes 集群上安装了 Rancher，则 `}<inlineCode parentName="p">{`export KUBECONFIG=$PWD/kube_config_rancher-cluster.yml`}</inlineCode>{` ），或者通过 UI 使用嵌入式 kubectl。`}</p>
                </blockquote>
                <pre parentName="li"><code parentName="pre" {...{
                    "className": "language-bash"
                  }}>{`kubectl -n cattle-system \\
logs \\
-l app=rancher \\
--timestamps=true
`}</code></pre>
              </li>
              <li parentName="ul">
                <p parentName="li">{`在 RKE 集群的每个节点通过 `}<inlineCode parentName="p">{`docker`}</inlineCode>{`安装的组件。`}</p>
                <pre parentName="li"><code parentName="pre" {...{
                    "className": "language-bash"
                  }}>{`docker logs \\
--timestamps \\
$(docker ps | grep -E "rancher/rancher@|rancher_rancher" | awk '{ print $1 }')
`}</code></pre>
              </li>
              <li parentName="ul">
                <p parentName="li">{`使用 RKE Add-On 安装在 Kubernetes 中的 Rancher Server`}</p>
                <blockquote parentName="li">
                  <p parentName="blockquote"><strong parentName="p">{`注意：`}</strong>{` 确保已配置正确的 kubeconfig（例如，如果 Rancher Server 安装在 Kubernetes 集群上，则 `}<inlineCode parentName="p">{`export KUBECONFIG=$PWD/kube_config_rancher-cluster.yml`}</inlineCode>{` )或通过 UI 使用嵌入式 kubectl。`}</p>
                </blockquote>
                <pre parentName="li"><code parentName="pre" {...{
                    "className": "language-bash"
                  }}>{`kubectl -n cattle-system \\
logs \\
--timestamps=true \\
-f $(kubectl --kubeconfig $KUBECONFIG get pods -n cattle-system -o json | jq -r '.items[] | select(.spec.containers[].name="cattle-server") | .metadata.name')
`}</code></pre>
              </li>
            </ul>
          </li>
          <li parentName="ul">
            <p parentName="li">{`系统日志（这些可能并不全部存在，具体取决于操作系统）`}</p>
